INSERT INTO `cocktails` (`id`, `name`, `description`, `price`, `category_id`, `position`, `created_at`, `updated_at`, `image`, `visible`) VALUES
(28, 'La Montaña', 'Rum Añejo, sweet vermouth, licor averna y angostura. Cóctel aperitivo, spirit forward.  Perfecto para comenzar.', 10.00, 5, 1, '2025-05-16 17:45:00', '2025-11-22 22:52:06', 'cocktail_images/TNGFRQLnl5XDAFmsvp1ABGb3p62NYYsJkRvQqhrV.jpg', 1),
(29, 'Asado', 'Fat wash de Ron Barrilito 3 y grasa de costillas ahumadas, sirope de pimienta negra y bitter aromaticos.  Acompañado de una deliciosa costilla la cual complemente el cóctel.', 15.00, 5, 2, '2025-05-16 17:55:44', '2025-11-22 22:42:29', 'cocktail_images/fp7FHHV1nxtNRzNTlGfsMvGKREEmnY5819Nr54AZ.jpg', 1),
(30, 'Conciencia', 'Mezcal, aperol, amargo italiano y chocolate bitter.  Cóctel aperitivo, spirit forward.  Perfecto para comenzar.', 10.00, 5, 3, '2025-05-16 17:58:56', '2025-11-22 22:52:24', 'cocktail_images/fciDV7hlCb1i74L70OVk3vTwHtnhYsHniDBimjA8.jpg', 1),
(31, 'Jardin de Elena', 'Cóctel refrescante a base  de vodka, st. germain, homemade raspberries / basil syrup and fresh lime.', 11.00, 5, 4, '2025-05-16 18:08:06', '2025-11-22 22:55:29', 'cocktail_images/gaIeWv4KfdOwvpbdO1I1vqq0gFeD8UaTRU24Zcie.jpg', 1),
(32, 'El Cielo', 'Cóctel interactivo mezclando vodka, vermouth bianco, genepy, cotton candy syrup, toronja rosada y cherry bitter.  Acompañado  de un algodón de azúcar.', 13.00, 5, 5, '2025-05-16 18:13:47', '2025-11-22 22:42:09', 'cocktail_images/Ude2lKWU3SOxS9zYu9dlxrRRoREmRvG75qmAddGQ.jpg', 1),
(34, 'Violeta', 'Cóctel floral que combina la ginebra, crema de violeta, st. germain, lima y cherry bitter. Terminado con vino espumoso.', 11.00, 5, 6, '2025-05-16 18:20:00', '2025-11-21 15:23:23', 'cocktail_images/Q4VNQrlG7a1vJ1ayxQwM6olVFcbJrHJmHwvFhXSN.jpg', 1),
(35, 'Mongo', 'Ginebra, grand marnier, sirope de romero, lima, ginger beer de flor de jamaica confeccionada en Asador. Conocido como nuestra variación de un London Mule.', 13.00, 5, 7, '2025-05-16 18:23:51', '2025-11-22 22:43:42', 'cocktail_images/XX9E45nOaitKmplwmb2ppM0JAIZkFXFC5vcJNduM.jpg', 1),
(36, 'El Mercado', 'Combina el tequila, una amarga y dulce fusión de aperol y piña hecha en la casa, lima y un toque de jugo de parcha.', 12.00, 5, 8, '2025-05-16 18:26:35', '2025-11-22 22:44:07', 'cocktail_images/jK5dLfxf5hHrYd6caYI39jkHhmWeHyIuMtAEC4CD.jpg', 1),
(37, 'El Milagro', 'Tequila, licor 43, agave reducido, crema de cassis, lima y aquafaba. Cóctel sedoso de perfil tropical.', 12.00, 5, 9, '2025-05-16 18:28:29', '2025-11-22 22:51:28', 'cocktail_images/AjReqemOKlsioXhxS5M97G5U4Oksfx9RE6A1tbti.jpg', 1),
(38, 'Flor de México', 'Mezcal, tequila, Licor Ancho Reyes (chiles secados al sol), sirope de flor de jamaica y tintura de limón. Una combinación balanceada que te permitirá saborear cada ingrediente de manera sutil.', 12.00, 5, 10, '2025-05-16 18:29:43', '2025-11-22 22:44:32', 'cocktail_images/p51K4Tj0fqy1LZGqmKxS1ApWENd2nBuiZTjn0hLF.jpg', 1),
(39, 'Mango Bajito', 'Mezcal, 1800 Coco, sirope mango y canela, lima y tintura de camomila. Cóctel amigable al paladar de perfil tropical.', 11.00, 5, 11, '2025-05-16 18:34:23', '2025-11-22 22:44:50', 'cocktail_images/xVJFoqemayzWAQNCmNdclP4VsLtPxOwY7FXYuuJ4.jpg', 1),
(40, 'Lado Obscuro', 'Scotch, fernet branca, tamarindo, lima, sirope de canela y chocolate bitter.', 12.00, 5, 12, '2025-05-16 18:47:48', '2025-11-22 22:49:20', 'cocktail_images/nkAGP67IlkscH32sjI5azYwcMYJRmrIp0NYKNBnf.jpg', 1),
(41, 'El Mañanero', 'Whiskey, licor averna, sirope de café y aromatic bitter. Terminado con espuma de coco. El cóctel perfecto para culminar tu cena.', 11.00, 5, 13, '2025-05-16 18:51:54', '2025-11-22 22:49:43', 'cocktail_images/w9EadwtO4wDMYxTB2CjphYyMElSxJLr3FUhGwo0u.jpg', 1),
(42, 'Arcángel', 'Rum, whiskey, licor amaretto, jugo de naranja, lima, sirope de mango, cúrcuma, jengibre; cardamom bitter. Nuestro cóctel tiki, de sabores exóticos y llamativos.', 13.00, 5, 14, '2025-05-16 18:52:38', '2025-11-22 22:50:20', 'cocktail_images/PXDrhmN6DMnexhzoiA30pKrVoaZI2o9BajdNM3x3.jpg', 1),
(44, 'Sabor del Caribe', 'Mocktail refrescante y herbal, inspirado en un Frech 75.   Sus ingredientes son: jugo de melón fresco, lima, efervescencia, infusión de albahaca y romero (Disponible como Cóctel $12.00)', 10.00, 5, 15, '2025-05-16 19:12:05', '2025-11-22 22:53:23', 'cocktail_images/HXZa18ytrHCFYUqymLbDq5vuZHy7yJudZAuPcflD.jpg', 1),
(45, 'Brisa Botánica', 'Mocktail botánico y refrescante.  Infusión de pepino fresco y romero, lima.  (Disponible como Cóctel $12.00)', 10.00, 5, 16, '2025-05-16 19:13:34', '2025-11-22 22:53:10', 'cocktail_images/tvFozm5bsnvn3AwEgBmNJAIgDpJcDgZr8WUINomo.jpg', 1),
(46, 'Néctar Dorado', 'Mocktail de sabores pronunciados y tropicales.  Contiene miel reducida, infusión de piña y tomillo.  (Disponible como Cóctel $12.00)', 10.00, 5, 17, '2025-05-16 19:23:08', '2025-11-22 22:54:49', 'cocktail_images/GZhOxpbuvaOSfphZk3ykLkZ2QyifdzuJEy57RasB.jpg', 1),
(48, 'San Rafael', 'Sabores caribeños y amigables.  Woodford, licor de parcha, licor de banana, sirope de coco, lima y cacao bitter.', 12.00, 5, 18, '2025-05-16 19:28:05', '2025-11-22 22:50:43', 'cocktail_images/XILqo7WBWXin4wGNyw9LA3Rjqs5Sm5Zess1nwrmh.jpg', 1),
(49, 'Sabor de Campo', 'Whiskey fusionado con miel, horchata, sirope de jengibre y canela y aromatic Bitter. Acompañado de un chocolate obscuro preparado en la casa (contiene nueces).', 11.00, 5, 19, '2025-05-16 19:28:53', '2025-11-22 22:51:06', 'cocktail_images/QZLid3QCD1EUayr9w4LjZ24XzcC33nyUIIbnyc60.jpg', 1);
